11\u0438\u0442\u0432\u0430 \u043f\u043e\u0434 \u0411\u0430\u0442\u043e\u0433\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1676_%D0%B3%D0%BE%D0%B4\" title=\"1676 \u0433\u043e\u0434\">1676<\/a>&#160;\u2014 \u043d\u0430 \u0421\u0440\u0435\u0434\u0438\u0437\u0435\u043c\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u043e\u043c \u0442\u0435\u0430\u0442\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%9F%D0%B0%D0%BB%D0%B5%D1%80%D0%BC%D0%BE\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u041f\u0430\u043b\u0435\u0440\u043c\u043e\">\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u041f\u0430\u043b\u0435\u0440\u043c\u043e<\/a> \u043c\u0435\u0436\u0434\u0443 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u043c \u0444\u043b\u043e\u0442\u043e\u043c \u0438 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u043c\u0438 \u0444\u043b\u043e\u0442\u0430\u043c\u0438 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u0439 \u0438 \u0418\u0441\u043f\u0430\u043d\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1782_%D0%B3%D0%BE%D0%B4\" title=\"1782 \u0433\u043e\u0434\">1782<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d Banco Nacional de San Carlos, \u0431\u0443\u0434\u0443\u0449\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BD%D0%BA_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u0411\u0430\u043d\u043a \u0418\u0441\u043f\u0430\u043d\u0438\u0438\">\u0411\u0430\u043d\u043a \u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1800_%D0%B3%D0%BE%D0%B4\" title=\"1800 \u0433\u043e\u0434\">1800<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%98%D1%82%D0%B0%D0%BB%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f\">\u0412\u0442\u043e\u0440\u0430\u044f \u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430 \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\u0430<\/a>: \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430 \u0437\u0430\u043d\u044f\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BB%D0%B0%D0%BD\" title=\"\u041c\u0438\u043b\u0430\u043d\">\u041c\u0438\u043b\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0430\u0440\u0442\u0438\u043d\u0438\u043a\u0430\">\u041c\u0430\u0440\u0442\u0438\u043d\u0438\u043a\u0430<\/a>: \u043f\u043e\u0441\u043b\u0435 <a href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Diamond_Rock\" class=\"extiw\" title=\"en:Battle of Diamond Rock\">\u0442\u0440\u0451\u0445\u0434\u043d\u0435\u0432\u043d\u043e\u0439 \u0431\u043e\u043c\u0431\u0430\u0440\u0434\u0438\u0440\u043e\u0432\u043a\u0438<\/a> \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0435, \u0437\u0430\u043d\u044f\u0432\u0448\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%B9%D0%BC%D0%BE%D0%BD%D0%B4_(%D1%81%D0%BA%D0%B0%D0%BB%D0%B0)\" class=\"mw-redirect\" title=\"\u0414\u0430\u0439\u043c\u043e\u043d\u0434 (\u0441\u043a\u0430\u043b\u0430)\">\u0410\u043b\u043c\u0430\u0437\u043d\u0443\u044e \u0441\u043a\u0430\u043b\u0443<\/a>, \u043a\u0430\u043f\u0438\u0442\u0443\u043b\u0438\u0440\u043e\u0432\u0430\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1851_%D0%B3%D0%BE%D0%B4\" title=\"1851 \u0433\u043e\u0434\">1851<\/a>&#160;\u2014 \u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8D%D0%BD_(%D1%88%D1%82%D0%B0%D1%82)\" title=\"\u041c\u044d\u043d (\u0448\u0442\u0430\u0442)\">\u041c\u044d\u043d<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>) \u043f\u0435\u0440\u0432\u044b\u043c \u0432\u0432\u0451\u043b \u043d\u0430 \u0441\u0432\u043e\u0435\u0439 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D1%85%D0%BE%D0%B9_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD\" title=\"\u0421\u0443\u0445\u043e\u0439 \u0437\u0430\u043a\u043e\u043d\">\u0441\u0443\u0445\u043e\u0439 \u0437\u0430\u043a\u043e\u043d<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1856_%D0%B3%D0%BE%D0%B4\" title=\"1856 \u0433\u043e\u0434\">1856<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D0%B2%D0%B5%D1%89%D0%B5%D0%BD%D1%81%D0%BA_(%D0%90%D0%BC%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)\" class=\"mw-redirect\" title=\"\u0411\u043b\u0430