440\u044b\u043b\u0430 \u0441\u0432\u043e\u0451 \u043f\u0435\u0440\u0432\u043e\u0435 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0435 \u0442\u0443\u0440\u043d\u0435 \u043a\u043e\u043d\u0446\u0435\u0440\u0442\u043e\u043c \u043d\u0430 \u0441\u0442\u0430\u0434\u0438\u043e\u043d\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 \u041b\u0438\u043d\u043d (\u0448\u0442. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%B0%D1%87%D1%83%D1%81%D0%B5%D1%82%D1%81\" title=\"\u041c\u0430\u0441\u0441\u0430\u0447\u0443\u0441\u0435\u0442\u0441\">\u041c\u0430\u0441\u0441\u0430\u0447\u0443\u0441\u0435\u0442\u0441<\/a>).<\/li><li>\u041d\u0430 \u0412\u043e\u043b\u0436\u0441\u043a\u043e\u043c \u0448\u0438\u043d\u043d\u043e\u043c \u0437\u0430\u0432\u043e\u0434\u0435 (\u0433. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B3%D1%80%D0%B0%D0%B4\" title=\"\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434\">\u0412\u043e\u043b\u0433\u043e\u0433\u0440\u0430\u0434<\/a>) \u0432\u044b\u043f\u0443\u0449\u0435\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u043f\u043e\u043a\u0440\u044b\u0448\u043a\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 \u0441\u043f\u0443\u0441\u0442\u044f 12 \u043b\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BD%D0%B0%D1%82%D1%80%D0%B0,_%D0%A4%D1%80%D1%8D%D0%BD%D1%81%D0%B8%D1%81_%D0%90%D0%BB%D1%8C%D0%B1%D0%B5%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u0421\u0438\u043d\u0430\u0442\u0440\u0430, \u0424\u0440\u044d\u043d\u0441\u0438\u0441 \u0410\u043b\u044c\u0431\u0435\u0440\u0442\">\u0424\u0440\u044d\u043d\u043a \u0421\u0438\u043d\u0430\u0442\u0440\u0430<\/a> \u043e\u043f\u044f\u0442\u044c \u043e\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u043d\u0430 \u043f\u0435\u0440\u0432\u043e\u043c \u043c\u0435\u0441\u0442\u0435 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043